import './App.css';
import Navbar from './app/Components/Navbar/Navbar';
import Main from './app/Components/main/Main';
import Events from './app/pages/Events/Events';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
 <>
 <Navbar/>
 <Switch>
          <Route path="/">
            <Main />
          </Route>
        </Switch>

 </>
  );
}

export default App;
